from myconnection import connect_to_mysql
from mysql.connector import Error

config = {
    "host": "127.0.0.1",
    "user": "root",
    "password": "",
    "database": "bankdb",
}

def execute_query(connection, query, values=None):
    try:
        with connection.cursor() as cursor:
            cursor.execute(query, values)
            connection.commit()
            print("Query executed successfully")
    except Error as e:
        print(f"Error: {e}")

def fetch_query(connection, query):
    try:
        with connection.cursor() as cursor:
            cursor.execute(query)
            return cursor.fetchall()
    except Error as e:
        print(f"Error: {e}")

def insert_account(connection, account_no, password, name, amount, phone):
    query = "INSERT INTO accounts(account_no, password, name, amount, phone) VALUES (%s, %s, %s, %s, %s)"
    values = (account_no, password, name, amount, phone)
    execute_query(connection, query, values)

def signup(connection):
    account_no = int(input('Enter account no: '))
    password = input('Enter Password: ')
    confirm_password = input('Enter Confirm Password: ')
    if len(password) < 8 or password != confirm_password:
        print('Password must be at least 8 characters and match the confirmation.')
        return
    name = input('Enter your name: ')
    amount = int(input('Enter Initial Deposit amount: '))
    phone = input('Enter your phone no: ')
    insert_account(connection, account_no, password, name, amount, phone)

def deposit_money(connection, account_no, deposit_amount):
    query = 'UPDATE accounts SET amount = amount + %s WHERE account_no = %s'
    execute_query(connection, query, (deposit_amount, account_no))

def withdraw_money(connection, account_no, withdraw_amount):
    query = 'UPDATE accounts SET amount = amount - %s WHERE account_no = %s AND amount >= %s'
    values = (withdraw_amount, account_no, withdraw_amount)
    execute_query(connection, query, values)

def show_user_accounts(connection, account_no):
    query = 'SELECT * FROM accounts WHERE account_no = %s'
    data = fetch_query(connection, query, (account_no,))
    for row in data:
        print(row)

def signin(connection):
    account_no = int(input('Enter account no: '))
    password = input('Enter Password: ')
    query = 'SELECT * FROM accounts WHERE account_no = %s AND password = %s'
    data = fetch_query(connection, query, (account_no, password))
    if data:
        print('Successfully Signin!')
        return True, account_no
    else:
        print('Wrong username or password.')
        return False, None

def main():
    connection = connect_to_mysql(config, attempts=3)
    if not connection or not connection.is_connected():
        print('Connection error!, Bye')
        return

    while True:
        sign_in_status, account_no = signin(connection)
        if sign_in_status:
            break
        ans = input('Try again? (y/n): ')
        if ans.lower() != 'y':
            print('Bye!')
            return

    while True:
        print('0-Exit')
        print('1-Create Account')
        print('2-Deposit Money')
        print('3-Withdraw Money')
        print('4-Show Amount')
        ans = input('Enter your choice(0,1,2,3,4): ')

        if ans == '0':
            print('Bye')
            connection.close()
            return
        elif ans == '1':
            print('Welcome:')
            signup(connection)
        elif ans == '2':
            deposit_amount = int(input('Enter amount to deposit: '))
            deposit_money(connection, account_no, deposit_amount)
        elif ans == '3':
            withdraw_amount = int(input('Enter amount to withdraw: '))
            withdraw_money(connection, account_no, withdraw_amount)
        elif ans == '4':
            show_user_accounts(connection, account_no)

if __name__ == "__main__":
    main()

function pointsValidation(arr) {
  let x1 = arr[0];
  let y1 = arr[1];
  let x2 = arr[2];
  let y2 = arr[3];

  function formula(x1, y1, x2, y2) {
    let deltaX = x2 - x1;
    let deltaY = y2 - y1;
    let total = Math.sqrt(deltaX * deltaX + deltaY * deltaY);

    if (total % 1 === 0) {
      console.log(`{${x1}, ${y1}} to {${x2}, ${y2}} is valid`);
    } else {
      console.log(`{${x1}, ${y1}} to {${x2}, ${y2}} is invalid`);
    }
  }

  formula(x1, y1, 0, 0);
  formula(x2, y2, 0, 0);
  formula(x1, y1, x2, y2);
}

// gaussian integers implementation
// solution to https://acm.timus.ru/problem.aspx?space=1&num=1845

#include <bits/stdc++.h>
#define int long long
using namespace std;

struct gauss {
    int re, im;

    gauss() : re(0), im(0) {}
    gauss(int re, int im) : re(re), im(im) {}
    gauss(int a) : gauss(a, 0) {}

    friend gauss operator+(const gauss& a, const gauss b) {
        return {a.re + b.re, a.im + b.im};
    }

    friend gauss operator-(const gauss& a, const gauss b) {
        return {a.re - b.re, a.im - b.im};
    }

    friend gauss operator*(const gauss& a, const gauss b) {
        return {a.re * b.re - a.im * b.im, a.re * b.im + a.im * b.re};
    }

    gauss& operator-=(const gauss& other) {
        re -= other.re;
        im -= other.im;
        return *this;
    }

    gauss& operator+=(const gauss& other) {
        re += other.re;
        im += other.im;
        return *this;
    }

    gauss& operator*=(const gauss& other) {
        *this = (*this) * other;
        return *this;
    }

    gauss& operator/=(const gauss& other) {
        *this = (*this) / other;
        return *this;
    }

    gauss& operator%=(const gauss& other) {
        *this = (*this % other);
        return *this;
    }

    gauss conj() const {
        return {re, -im};
    }

    int norm2() const {
        return re * re + im * im;
    }

    friend gauss operator/(const gauss& a, const gauss b) {
        auto top = a * b.conj();
        int n = b.norm2();
        gauss res{abs(top.re) / n, abs(top.im) / n};
        if (abs(top.re) % n > n / 2)
            res.re++;
        if (abs(top.im) % n > n / 2)
            res.im++;
        if (top.re < 0)
            res.re *= -1;
        if (top.im < 0)
            res.im *= -1;
        return res;
    }

    friend gauss operator%(const gauss& a, const gauss& b) {
        return a - (a / b) * b;
    }

    friend bool operator==(const gauss& a, const gauss& b) {
        return a.re == b.re && a.im == b.im;
    }

    friend bool operator!=(const gauss& a, const gauss& b) {
        return !(a == b);
    }

    friend ostream& operator<<(ostream& os, const gauss& a) {
        os << a.re;
        if (a.im >= 0) os << "+";
        else os << "-";
        os << abs(a.im) << "i";
        return os;
    }
};

void solve() {
    int n; cin >> n;
    vector<vector<gauss>> a(n, vector<gauss>(n));
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            cin >> a[i][j].re >> a[i][j].im;
        }
    }
    gauss p;
    cin >> p.re >> p.im;
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            a[i][j] %= p;
        }
    }
    int sign = 1;
    vector<int> who(n, -1);
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            if (a[i][j] != 0) {
                who[i] = j;
                break;
            }
        }
        if (who[i] == -1) {
            cout << "0 0\n";
            return;
        }
        int k = who[i];
        for (int j = i + 1; j < n; ++j) {
            while (a[i][k].norm2() > 0 && a[j][k].norm2() > 0) {
                if (a[i][k].norm2() > a[j][k].norm2()) {
                    auto t = a[i][k] / a[j][k];
                    for (int w = 0; w < n; ++w) {
                        a[i][w] -= t * a[j][w];
                        a[i][w] %= p;
                    }
                } else {
                    auto t = a[j][k] / a[i][k];
                    for (int w = 0; w < n; ++w) {
                        a[j][w] -= t * a[i][w];
                        a[j][w] %= p;
                    }
                }
            }
            if (a[i][k] == 0) {
                swap(a[i], a[j]);
                sign *= -1;
            }
        }
    }
    gauss res = 1;
    for (int i = 0; i < n; ++i) {
        res *= a[i][who[i]];
        res %= p;
        int ishak = 0;
        for (int j = 0; j < i; ++j) {
            ishak += (who[j] < who[i]);
        }
        if (i % 2 != ishak % 2)
            res *= -1;
        res %= p;
    }
    res *= sign;
    res %= p;
    cout << res.re << " " << res.im << "\n";
}

int32_t main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.precision(20);

    solve();
}

